`timescale 1ns / 1ps

module testbench;
    reg clk;                    // Clock signal                  // Reset signal
    reg [50000:0] mat;              // 8-bit input signal
    wire [99:0] arr;            // 100-bit output signal

    // Instantiate the DUT (Device Under Test)
    pin_control uut (
        .clk(clk),
        .mat(mat),
        .arr(arr)
    );

    // Clock generation
    initial begin
        clk = 0;
        forever #5 clk = ~clk; // Generate a clock with a 10 ns period
    end

    // Input stimulus for mat
    initial begin

        // Set the 8-bit input
        mat[50000:0] = 50000';      // Example value
        #1000000;                  // Wait for enough simulation time
        $stop;                  // Stop simulation
    end
endmodule